  selector: 'app-site',
  templateUrl: './site.component.html',
  styleUrls: ['./site.component.scss']
})
export class SiteComponent {
  @Input({ required: true }) data!: Site

}
<td>{{ data.id }}</td>
<td>{{ data.checked }}</td>
